import Link from "next/link";
import Head from 'next/head';

const Layout = props => {
  return (
    <div>
      <Head>
        <title>Cajero - Cyclos</title>
        <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"></link>
        <link rel="stylesheet" href="/css/all.min.css"></link>
      </Head>
      <nav className="navbar navbar-dark bg-dark">
        <Link href="/">
          <a className="navbar-brand col-md-2 mr-0">Cajero.co</a>
        </Link>
      </nav>
      <div className="row">
        <nav className="col-md-2 d-none d-md-block bg-light sidebar">
          <div className="sidebar-nav">
            <ul className="nav flex-column">

              <h6 className="sidebar-heading d-flex justify-content-between align-items-center px-3 mt-4 mb-1 text-muted">
                <span>Actualizar cliente </span>
              </h6>

              <li className="nav-item">
                <Link href="/WebDesktop/Micuenta">
                  <a className="nav-link"><i className="far fa-address-card"></i> Mi Cuenta</a>
                </Link>
              </li>
              <li className="nav-item">
                <Link href="/WebDesktop/Micuenta">
                  <a className="nav-link"><i className="fas fa-coins"></i> Cuenta Retiros</a>
                </Link>
              </li>

            </ul>
          </div>
        </nav>
        <div className="col-md-9">
          {props.children}
        </div>
      </div> 
      <style jsx>{`
        .sidebar-nav {
          height: calc(100vh - 48px);
          overflow-x: hidden;
          overflow-y: auto;
        }
      `}</style> 
    </div>
  );
};

export default Layout;
